import React from "react";

import { makeStyles } from "@material-ui/core/styles";
import {
  Card,
  CardContent,
  TextField,
  Typography,
  Button,
  TextareaAutosize
} from "@material-ui/core";
//eslint-disable-next-line
const url = "http://localhost:5000/users";

const useStyles = makeStyles(theme => ({
  test: {
    position: "relative",
    marginLeft: "auto",
    marginRight: "auto",
    width: "100%",
    height: "100%"
  },
  loginCard: {
    justifyContent: "center",
    alignItems: "center",
    display: "flex",
    boxShadow: "0 3px 6px rgba(0,0,0,0.19), 0 10px 15px rgba(0,0,0,0.23)",
    minWidth: "300px",
    margin: "10px auto",
    padding: "8%",
    zIndex: 1
  },
  textField: {
    display: "block",
    marginBottom: "30px",
    "& label.Mui-focused": {
      color: "#57575F"
    },
    "& .MuiInput-underline:after": {
      borderBottomColor: "#57575F"
    }
  },
  submit: {
    margin: "auto",
    display: "inherit",
    width: "200px",
    height: "50px",
    borderRadius: "30px"
  }
}));
function Post() {
  const classes = useStyles();
  return (
    <div className={classes.test}>
      <Card className={classes.loginCard}>
        <CardContent>
          <Typography
            className={classes.title}
            variant="h3"
            color="textPrimary"
          >
            Submit New Post
          </Typography>
          <form noValidate autoComplete="off">
            <TextField className={classes.textField} label="Post Title" />
            <TextareaAutosize
              aria-label="Post"
              rowsMin={8}
              placeholder="Post"
            />
            <TextField
              id="outlined-multiline-static"
              label="Post"
              multiline
              rows="15"
              defaultValue="Default Value"
              variant="outlined"
              width="100%"
            />
            <Button
              type="submit"
              variant="contained"
              className={classes.submit}
            >
              작성완료
            </Button>
          </form>
        </CardContent>
      </Card>
    </div>
  );
}

export default Post;
